style.css:
@-moz-document domain("roblox.com") {
body {
        background-image: url("https://media.discordapp.net/attachments/1010578169226596412/1066653764259434537/IMG_6446.gif?ex=665060ba&is=664f0f3a&hm=b9d0eac2c0549d4a211cbbc5367754ade9ac3d593e94ccada55dc39b381f46da") !important;
        background-repeat: no-repeat !important;
        background-attachment: fixed !important;
        background-position: center center !important;
        background-size: cover !important;
    }
    
    .container, .navbar, .footer, .content {
        background-color: rgba(31, 30, 28, 0.8) !important;
    }
    
    .text, .link, .title {
        color: #ffffff !important;
    }
}
